// CardComponent.tsx
import React from 'react';
import { CardComponentStyled, CardUpper ,CardUppermore, FullDiv, Leftpart, LeftTextpart, Styledimage, Upperpart, UpperText ,Outerleftpartdiv,
   LeftBottomText, Rightpart,Imagediv, RightTextpart, RightBottomText, 
   CardMiddle,LeftMost,
   CardMiddleLeft,
   MarginBetween,
   Rightmost,
   Styledrepayment,
   CardMiddleRight,
   StyledLower,StyledButton} from "../Dashboard.styles";
import { useNavigate } from 'react-router-dom';
  

interface CardProps {
  
  
  _id: string;
  BuyerName: string;
  SellerName: string;
  UnitPrice:number;
  TotalUnits: number;
  Tenure: number;
 RemainingUnits:number;
  Xirr: number;
  Repayment:string;
  ImageBuyer:string;
  ImageSeller:string;
}

const CardComponent: React.FC<CardProps> = ({ _id, ImageBuyer,ImageSeller,BuyerName, SellerName, Repayment, Tenure, UnitPrice, TotalUnits, Xirr, RemainingUnits }) => {
  const nav=useNavigate();
  function onclickhandler(){
     nav('/productdetails')
  }
  return (
    <CardComponentStyled>
      <CardUpper>
        <CardUppermore>
          <UpperText>
           INVOICE DISCOUNTING
          </UpperText>
          <FullDiv>
            <Upperpart>
              <Leftpart>
                <Styledimage src={ImageBuyer}/>
                <Outerleftpartdiv>
                <LeftTextpart>Buyer</LeftTextpart>
                <LeftBottomText>{BuyerName}</LeftBottomText>
                </Outerleftpartdiv>
                
              </Leftpart>
              <Rightpart>
              <Imagediv>
                <Styledimage src={ImageSeller}/>
                </Imagediv>
              <Outerleftpartdiv>
               
               
                <RightTextpart>Seller</RightTextpart>
                <RightBottomText>{SellerName}</RightBottomText>
                
               </Outerleftpartdiv>
              </Rightpart>

            </Upperpart>
            <CardMiddle>
               <CardMiddleLeft>
                <LeftMost>
                 <LeftTextpart>Unit Cost</LeftTextpart>
                 <LeftBottomText>₹ {UnitPrice}</LeftBottomText>

                </LeftMost>
                <MarginBetween></MarginBetween>
                <Rightmost>
                <LeftTextpart>Repayment/Unit</LeftTextpart>
                <Styledrepayment>₹ {Repayment}</Styledrepayment>

                </Rightmost>
            
               </CardMiddleLeft>
               <CardMiddleRight>
               <LeftTextpart>XIRR</LeftTextpart>
               <LeftBottomText>{Xirr}</LeftBottomText>
               </CardMiddleRight>


      </CardMiddle>
      <StyledLower>
                <LeftMost>
                 <LeftTextpart>Units Left</LeftTextpart>
                 <LeftBottomText>{RemainingUnits}/{TotalUnits}</LeftBottomText>
                 

                </LeftMost>

                <CardMiddleRight>
               <LeftTextpart>Tenure</LeftTextpart>
               <LeftBottomText>{Tenure} Days</LeftBottomText>
               </CardMiddleRight>

      </StyledLower>
      <StyledButton onClick={onclickhandler}>Buy Now</StyledButton>


          </FullDiv>
          
          </CardUppermore>  
          
      

      </CardUpper>

    </CardComponentStyled>
  );
};

export default CardComponent;
